import { StyleSheet } from 'react-native';

const style = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: '#141428',
        alignItems: 'center',
        justifyContent: 'center',
        aspectRatio: '1125/2436',
        width: '100vw',
    },

    title: {
        color: '#C8DCFF'
    },
});

export { style }
